import React from 'react';
import { Disclosure, Menu } from '@headlessui/react';
import { Link } from 'react-router-dom'; // Assuming you are using React Router for navigation
import { useAuth } from '../context/AuthContext'; // Assuming you have an AuthContext for authentication

const navigation = [
  { name: 'Home', href: '/' },
  { name: 'Startup', href: '/AllStartups', dropdown: true, menuItems: [
    { name: 'All Startups', href: '/AllStartups' },
    { name: 'Add Startup', href: '/AddStartup' }
  ] },
  { name: 'Investor', href: '/AllInvestors', dropdown: true, menuItems: [
    { name: 'All Investors', href: '/AllInvestors' },
    { name: 'Add Investor', href: '/AddInvestor' }
  ] },
  { name: 'Blog', href: '/AllBlogs' }
];

function classNames(...classes) {
  return classes.filter(Boolean).join(' ');
}

const Navbar = () => {
  const { currentUser, logout } = useAuth(); // Replace with your authentication context functions

  return (
    <Disclosure as="nav" className="bg-gray-800">
      {({ open }) => (
        <>
          <div className="mx-auto max-w-7xl px-2 sm:px-6 lg:px-8">
            <div className="relative flex items-center justify-between h-16">
              {/* Mobile menu button */}
              <Disclosure.Button className="absolute inset-y-0 left-0 flex items-center sm:hidden">
                <span className="sr-only">Open main menu</span>
                {open ? (
                  <svg
                    className="block h-6 w-6"
                    xmlns="http://www.w3.org/2000/svg"
                    fill="none"
                    viewBox="0 0 24 24"
                    stroke="currentColor"
                    aria-hidden="true"
                  >
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth={2}
                      d="M6 18L18 6M6 6l12 12"
                    />
                  </svg>
                ) : (
                  <svg
                    className="block h-6 w-6"
                    xmlns="http://www.w3.org/2000/svg"
                    fill="none"
                    viewBox="0 0 24 24"
                    stroke="currentColor"
                    aria-hidden="true"
                  >
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth={2}
                      d="M4 6h16M4 12h16m-7 6h7"
                    />
                  </svg>
                )}
              </Disclosure.Button>

              {/* Logo */}
              <div className="flex-shrink-0">
                <Link to="/" className="flex items-center">
                  <img
                    className="h-8 w-auto"
                    src="https://tailwindui.com/img/logos/mark.svg?color=indigo&shade=500"
                    alt="Your Company"
                  />
                </Link>
              </div>

              {/* Desktop menu */}
              <div className="hidden sm:block sm:ml-6">
                <div className="flex space-x-4">
                  {navigation.map((item) => (
                    <React.Fragment key={item.name}>
                      {item.dropdown ? (
                        <Menu as="div" className="relative">
                          <Menu.Button className="group flex items-center px-3 py-2 text-sm font-medium rounded-md text-white hover:bg-gray-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-gray-800 focus:ring-white">
                            {item.name}
                          </Menu.Button>
                          <Menu.Items className="absolute right-0 z-10 mt-2 w-48 origin-top-right bg-white divide-y divide-gray-100 rounded-md shadow-lg ring-1 ring-black ring-opacity-5 focus:outline-none">
                            {item.menuItems.map((menuItem) => (
                              <Menu.Item key={menuItem.name}>
                                {({ active }) => (
                                  <Link
                                    to={menuItem.href}
                                    className={classNames(
                                      active ? 'bg-gray-100' : '',
                                      'group flex items-center px-4 py-2 text-sm text-gray-700'
                                    )}
                                  >
                                    {menuItem.name}
                                  </Link>
                                )}
                              </Menu.Item>
                            ))}
                          </Menu.Items>
                        </Menu>
                      ) : (
                        <Link
                          to={item.href}
                          className={classNames(
                            'text-gray-300 hover:bg-gray-700 hover:text-white',
                            'rounded-md px-3 py-2 text-sm font-medium',
                            { 'bg-gray-900 text-white': item.href === window.location.pathname }
                          )}
                        >
                          {item.name}
                        </Link>
                      )}
                    </React.Fragment>
                  ))}
                </div>
              </div>

              {/* Profile dropdown */}
              <div className="ml-auto">
                <Menu as="div" className="relative">
                  <Menu.Button className="flex items-center text-sm rounded-full bg-gray-800 text-white focus:outline-none focus:ring-2 focus:ring-white">
                    <span className="sr-only">Open user menu</span>
                    {currentUser ? (
                      <img
                        className="h-8 w-8 rounded-full"
                        src={currentUser.profilePictureUrl || '/default-profile.png'}
                        alt=""
                      />
                    ) : (
                      <svg
                        className="h-8 w-8 rounded-full"
                        xmlns="http://www.w3.org/2000/svg"
                        fill="none"
                        viewBox="0 0 24 24"
                        stroke="currentColor"
                        aria-hidden="true"
                      >
                        <path
                          strokeLinecap="round"
                          strokeLinejoin="round"
                          strokeWidth={2}
                          d="M4 6h16M4 12h16m-7 6h7"
                        />
                      </svg>
                    )}
                  </Menu.Button>
                  <Menu.Items className="absolute right-0 z-10 mt-2 w-48 origin-top-right bg-white divide-y divide-gray-100 rounded-md shadow-lg ring-1 ring-black ring-opacity-5 focus:outline-none">
                    {currentUser ? (
                      <>
                        <Menu.Item>
                          {({ active }) => (
                            <Link
                              to="/profile"
                              className={classNames(
                                active ? 'bg-gray-100' : '',
                                'block px-4 py-2 text-sm text-gray-700'
                              )}
                            >
                              Your Profile
                            </Link>
                          )}
                        </Menu.Item>
                        <Menu.Item>
                          {({ active }) => (
                            <Link
                              to="/logout"
                              onClick={logout}
                              className={classNames(
                                active ? 'bg-gray-100' : '',
                                'block px-4 py-2 text-sm text-gray-700'
                              )}
                            >
                              Logout
                            </Link>
                          )}
                        </Menu.Item>
                      </>
                    ) : (
                      <>
                        <Menu.Item>
                          {({ active }) => (
                            <Link
                              to="/login"
                              className={classNames(
                                active ? 'bg-gray-100' : '',
                                'block px-4 py-2 text-sm text-gray-700'
                              )}
                            >
                              Login
                            </Link>
                          )}
                        </Menu.Item>
                        <Menu.Item>
                          {({ active }) => (
                            <Link
                              to="/register"
                              className={classNames(
                                active ? 'bg-gray-100' : '',
                                'block px-4 py-2 text-sm text-gray-700'
                              )}
                            >
                              Register
                            </Link>
                          )}
                        </Menu.Item>
                      </>
                    )}
                  </Menu.Items>
                </Menu>
              </div>
            </div>
          </div>

          {/* Mobile menu */}
          <Disclosure.Panel className="sm:hidden">
            <div className="px-2 pt-2 pb-3 space-y-1">
              {navigation.map((item) => (
                <Link
                  key={item.name}
                  to={item.href}
                  className={classNames(
                    'block pl-3 pr-4 py-2 text-base font-medium',
                    'text-white hover:bg-gray-700 hover:text-white',
                    { 'bg-gray-900 text-white': item.href === window.location.pathname }
                  )}
                >
                  {item.name}
                </Link>
              ))}
            </div>
          </Disclosure.Panel>
        </>
      )}
    </Disclosure>
  );
};

export default Navbar;
